import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
//import {Link, NavLink} from 'react-router-dom';
//import Container from 'react-bootstrap/Container';
import { Link } from 'react-router-dom';
import  React from 'react';
function Menu() {
  return (
    <>
      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="#home">Navbar</Navbar.Brand>
          <Nav className="me-auto">
          <Nav.Link className="text-decoration-none text-white" to="/">
              {' '}
              {/* <Link className="text-decoration-none text-white" to="/"> */}
                Home
              {/* </Link> */}
            </Nav.Link>
            <Nav.Link className="text-decoration-none text-white" to="/Myprofile">
              {' '}
              {/* <Link className="text-decoration-none text-white" to="/profile"> */}
                Profile
              {/* </Link> */}
            </Nav.Link>

            <Nav.Link className="text-decoration-none text-white" to="/bank" >
              {' '}
            {/* <Link className="text-decoration-none text-white" to="/bank"> */}
                Bank
              {/* </Link> */}
            </Nav.Link>
          </Nav>
        </Container>
      </Navbar>
      <br />
    </>
  );
}

export default Menu;
